INSERT INTO `wp_posts` VALUES (1,1,'2018-05-26 17:53:44','2018-05-26 17:53:44','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit. Aliquam, assumenda facere nihil beatae dicta, aperiam officia maxime autem cupiditate suscipit minus in debitis nemo, reiciendis perspiciatis blanditiis laboriosam libero eligendi.','Hello world!','','publish','open','open','','hello-world','','','2018-09-13 13:08:25','2018-09-13 13:08:25','',0,'http://page5.ph/?p=1',0,'post','',1),(2,1,'2018-05-26 17:53:44','2018-05-26 17:53:44','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://page5.ph/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Page5ph','','publish','closed','open','','sample-page','','','2018-09-11 16:02:35','2018-09-11 16:02:35','',0,'http://page5.ph/?page_id=2',0,'page','',0),(3,1,'2018-05-26 17:53:44','2018-05-26 17:53:44','','Privacy Policy','','publish','closed','open','','privacy-policy','','','2018-09-11 14:35:16','2018-09-11 14:35:16','',0,'http://page5.ph/?page_id=3',0,'page','',0),(5,1,'2018-08-30 12:02:31','2018-08-30 12:02:31','a